import React from "react";
import { Routes, Route } from "react-router-dom";
import "./App.css";

// Layouts and Protection
import PublicLayout from "./layouts/PublicLayout";
import DashboardLayout from "./layouts/DashboardLayout";
import AdminDashboardLayout from "./layouts/AdminDashboardLayout";
import ProtectedRoute from "./components/common/ProtectedRoute";
import AdminProtectedRoute from "./components/common/AdminProtectedRoute";
import GuestRoute from "./components/common/GuestRoute";

// Public Pages
import HomePage from "./pages/HomePage";
import AboutPage from "./pages/AboutPage";
import ContactPage from "./pages/ContactPage";
import HistoryPage from "./pages/HistoryPage";
import GalleryPage from "./pages/GalleryPage";
import AdministrationPage from "./pages/AdministrationPage";

// Auth Pages
import LoginPage from "./pages/auth/LoginPage";
import RegisterPage from "./pages/auth/RegisterPage";
import ForgotPasswordPage from "./pages/auth/ForgotPasswordPage";
import ResetPasswordPage from "./pages/auth/ResetPasswordPage";

// User Dashboard Pages
import UserHome from "./pages/user_dashboard/UserHome";
import MySubmissions from "./pages/user_dashboard/MySubmissions";
import Profile from "./pages/user_dashboard/Profile";
import SubmitRequest from "./pages/user_dashboard/SubmitRequest";
import LiveRateView from "./pages/user_dashboard/LiveRateView"; // ✅ NEW

// Admin Dashboard Pages
import AdminHome from "./pages/admin_dashboard/AdminHome";
import BillRequests from "./pages/admin_dashboard/BillRequests";
import ManageShifts from "./pages/admin_dashboard/ManageShifts";
import StockManagement from "./pages/admin_dashboard/StockManagement";
import AdminLeavePage from "./pages/admin_dashboard/AdminLeavePage";
import LiveRatePage from "./pages/admin_dashboard/LiveRatePage"; // ✅ NEW
import ManageRates from "./pages/admin_dashboard/ManageRates";   // ✅ NEW

function App() {
  return (
    <Routes>
      {/* Public Routes */}
      <Route element={<PublicLayout />}>
        <Route path="/" element={<HomePage />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/history" element={<HistoryPage />} />
        <Route path="/gallery" element={<GalleryPage />} />
        <Route path="/contact" element={<ContactPage />} />
        <Route path="/administration" element={<AdministrationPage />} />
      </Route>

      {/* Auth Routes */}
      <Route
        path="/login"
        element={
          <GuestRoute>
            <LoginPage />
          </GuestRoute>
        }
      />
      <Route
        path="/register"
        element={
          <GuestRoute>
            <RegisterPage />
          </GuestRoute>
        }
      />
      <Route
        path="/forgot-password"
        element={
          <GuestRoute>
            <ForgotPasswordPage />
          </GuestRoute>
        }
      />
      <Route
        path="/reset-password/:token"
        element={
          <GuestRoute>
            <ResetPasswordPage />
          </GuestRoute>
        }
      />

      {/* User Dashboard Routes */}
      <Route
        path="/user/home"
        element={
          <ProtectedRoute>
            <DashboardLayout>
              <UserHome />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />
      <Route
        path="/user/submissions"
        element={
          <ProtectedRoute>
            <DashboardLayout>
              <MySubmissions />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />
      <Route
        path="/user/profile"
        element={
          <ProtectedRoute>
            <DashboardLayout>
              <Profile />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />
      <Route
        path="/user/submit-request"
        element={
          <ProtectedRoute>
            <DashboardLayout>
              <SubmitRequest />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />
      <Route
        path="/user/live-rate" // ✅ NEW User Live Rate View
        element={
          <ProtectedRoute>
            <DashboardLayout>
              <LiveRateView />
            </DashboardLayout>
          </ProtectedRoute>
        }
      />

      {/* Admin Dashboard Routes */}
      <Route
        path="/admin/home"
        element={
          <AdminProtectedRoute>
            <AdminDashboardLayout>
              <AdminHome />
            </AdminDashboardLayout>
          </AdminProtectedRoute>
        }
      />
      <Route
        path="/admin/bills"
        element={
          <AdminProtectedRoute>
            <AdminDashboardLayout>
              <BillRequests />
            </AdminDashboardLayout>
          </AdminProtectedRoute>
        }
      />
      <Route
        path="/admin/shifts"
        element={
          <AdminProtectedRoute>
            <AdminDashboardLayout>
              <ManageShifts />
            </AdminDashboardLayout>
          </AdminProtectedRoute>
        }
      />
      <Route
        path="/admin/stock"
        element={
          <AdminProtectedRoute>
            <AdminDashboardLayout>
              <StockManagement />
            </AdminDashboardLayout>
          </AdminProtectedRoute>
        }
      />
      <Route
        path="/admin/leave"
        element={
          <AdminProtectedRoute>
            <AdminDashboardLayout>
              <AdminLeavePage />
            </AdminDashboardLayout>
          </AdminProtectedRoute>
        }
      />
      <Route
        path="/admin/live-rate" // ✅ Admin Upload/Update
        element={
          <AdminProtectedRoute>
            <AdminDashboardLayout>
              <LiveRatePage />
            </AdminDashboardLayout>
          </AdminProtectedRoute>
        }
      />
      <Route
        path="/admin/manage-rates" // ✅ Admin Rate History
        element={
          <AdminProtectedRoute>
            <AdminDashboardLayout>
              <ManageRates />
            </AdminDashboardLayout>
          </AdminProtectedRoute>
        }
      />
    </Routes>
  );
}

export default App;
